import React, { useState } from 'react';
import './App.css';

function App() {
  // Sample data for 20 movies
  const [movies, setMovies] = useState(
    Array.from({ length: 20 }, (_, index) => ({
      id: index + 1,
      name: `Movie ${index + 1}`,
      collections: [0, 0, 0], // Day 1, Day 2, Day 3...
    }))
  );

  const updateCollection = (movieId, day, value) => {
    const updatedMovies = movies.map(movie => 
      movie.id === movieId ? { ...movie, collections: { ...movie.collections, [day]: value } } : movie
    );
    setMovies(updatedMovies);
  };

  return (
    <div className="App">
      <h1>Box Office Collection Tracker</h1>
      <table>
        <thead>
          <tr>
            <th>Movie Name</th>
            <th>Day 1 Collection</th>
            <th>Day 2 Collection</th>
            <th>Day 3 Collection</th>
            {/* Add more days as needed */}
          </tr>
        </thead>
        <tbody>
          {movies.map(movie => (
            <tr key={movie.id}>
              <td>{movie.name}</td>
              {movie.collections.map((collection, dayIndex) => (
                <td key={dayIndex + 1}>
                  <input
                    type="number"
                    value={collection}
                    onChange={(e) => updateCollection(movie.id, dayIndex + 1, e.target.value)}
                  />
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
